function CBackup(props) {
    const dt_cadastro = new Date(props.dt_cadastro);
    const dt_realizado = new Date(props.dt_realizado);
  
    return (
      <>
        <div className="card" style={{ width: "18rem" }}>
          <img className="card-img-top" src="../../assets/pasta.png" alt="Imagem de capa do card" />
          <div className="card-body">
            <h5 className="card-title">{props.codigo}: {props.descricao}</h5>
            <p className="card-text">Hora: {props.hora_backup}</p>
            <p className="card-text">Data Cadastro: {dt_cadastro}</p>
            <p className="card-text">Ultima atualização: {dt_realizado}</p>
            <a href="/backup/:idbackup" className="btn btn-primary">Visualizar</a>
          </div>
        </div>
      </>
    );
  }
  
  export { CBackup };
